    "contracts/BinariGame.sol": {
      "content": "//SPDX-License-Identifier: MIT
pragma solidity 0.8.17;

import "@openzeppelin/contracts/access/AccessControl.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";
import "@openzeppelin/contracts/token/ERC20/utils/SafeERC20.sol";
import "./IAwardVault.sol";
import "./IWhiteListToken.sol";

import "hardhat/console.sol";

contract BinaryGame is AccessControl, ReentrancyGuard {

    using SafeERC20 for IERC20;

    bytes32 public constant CONTROLLER_ROLE = 0x7b765e0e932d348852a6f810bfa1ab891e259123f02db8cdcde614c570223357;

    bool public paused;
    uint64 private tax = 0.001 ether;
    uint64 public poolBetsLimit;

    uint256 public minBetAmount = 0.015 ether;
    uint256 public minBetAmount6decimals = 15000;  //0.015 amount 
    IAwardVault public awardVault;
    IWhiteListToken public whiteListToken;
    address public admin;
    address public taxWallet;

    event MakeBet(bytes32 pool, address userWallet, uint amount, uint direction,uint totalUpdated, address token);
    event PriceDefined(bytes32 poolId, int256 _startprice);
    event PrizePaid(bytes32 poolId,address userWallet, uint256 bet, uint256 reward, uint256 percentage,address token);
    event ReturnBet(bytes32 poolId, address userWallet, uint256 bet, address token);
    event tiedRound(bytes32 poolId,  int256 _startPrice, int256 _endPrice,bytes32 _newPoolId, address token);
    event InvalidFeeAmount(uint256 feeContract, uint256 feeReceived, address token);
    event FeePaid(address userWallet, uint256 amount, address token);
    event Jackpot(address recipient,uint256 prize, address token);

    struct TradersInfo {
        uint256[] bets;
        address[] addresses;
        bytes32[] whiteLabels;
        uint256 total;
    }

    struct Turn {
        int256 startPrice;
        int256 endPrice;
        TradersInfo upBet;
        TradersInfo downBet;
        address token;
    }

    struct Profits {
        uint256 percentage;
        uint256 reward;
        uint256 prizePool;
    }

    mapping(bytes32 => Turn) private pools;   
    mapping(address => uint256) public investor;

    constructor(address _controller, uint64 _poolBetsLimit, address _awardVault, address _whiteListToken, address _taxWallet) {
        _grantRole(DEFAULT_ADMIN_ROLE, msg.sender);
        _grantRole(DEFAULT_ADMIN_ROLE, _controller);
        _grantRole(CONTROLLER_ROLE, _controller);
        poolBetsLimit = _poolBetsLimit;
        awardVault = IAwardVault(_awardVault);
        whiteListToken = IWhiteListToken(_whiteListToken);
        admin = _controller;
        taxWallet = _taxWallet;
    }

    modifier onlyAdministrator () {
        if(!hasRole(DEFAULT_ADMIN_ROLE,msg.sender)){
            revert ("Only administrator");
        }
        _;
    }

    modifier onlyGame () {
        if(!hasRole(CONTROLLER_ROLE,msg.sender)){
            revert ("Only Game");
        }
        _;
    }

    modifier isPaused () {
        if(paused){
            revert ("Game paused");
        }
        _;
    }

    modifier poolExists (bytes32 poolId) {
        if(pools[poolId].startPrice == 0){ 
            revert ("Pool not exist");
        }
        _;
    }

    modifier validToken(address token) {
        if(token == address(0)){
            revert("gives an address");
        }
        if(!whiteListToken.getTokenAccess(token)){
            revert ("Invalid token");
        }
        _;
    }

    function setStartPrice(bytes32 poolId,int256 _startprice) public onlyGame isPaused {
        pools[poolId].startPrice = _startprice;
        emit PriceDefined(poolId, _startprice);
    }

    ///@param up 1 for trade up and 2 for trade down
    function makeBet(bytes32 id, uint256 up, bytes32 wl) public payable nonReentrant isPaused {

        if(msg.value < (minBetAmount + tax)){
            revert("less amount");
        }

        Turn memory turnInfo = pools[id];

        if(turnInfo.startPrice != 0){
            revert ("trade end");
        }

        sendTax();

        uint realbet = msg.value - tax;

        if(up == 1){
            if(turnInfo.upBet.bets.length >= poolBetsLimit){
                revert ("no more trades accepted");
            }

            pools[id].upBet.bets.push(realbet);
            pools[id].upBet.addresses.push(msg.sender);
            pools[id].upBet.whiteLabels.push(wl);
            turnInfo.upBet.total = pools[id].upBet.total += realbet;
            emit MakeBet(id, msg.sender, realbet, up, turnInfo.upBet.total, address(0));
        }else if(up == 2){
            if( turnInfo.downBet.bets.length >= poolBetsLimit){
                revert ("no more trades accepted");
            }
            pools[id].downBet.bets.push(realbet);
            pools[id].downBet.addresses.push(msg.sender);
            pools[id].downBet.whiteLabels.push(wl);
            turnInfo.downBet.total = pools[id].downBet.total += realbet;
            emit MakeBet(id, msg.sender, realbet, up, turnInfo.downBet.total, address(0));
        } else {
            revert("only up or down");
        }   
    }  

     function makeTokenBet(bytes32 id, uint256 up, address token, uint256 bet, bytes32 wl) public payable nonReentrant isPaused validToken(token){
        validateBet(bet,token);

        Turn memory turnInfo = pools[id];

        if(turnInfo.startPrice != 0){
            revert ("trade end");
        }

        if(turnInfo.token == address(0)){
            pools[id].token = token;
        } else {
            if(turnInfo.token != token){
                revert ("token defined");
            }
        }

        IERC20(token).safeTransferFrom(msg.sender,address(this),bet);

        sendTax();

        if(up == 1){
            if(turnInfo.upBet.bets.length >= poolBetsLimit){
                revert ("no more trades accepted");
            }
            pools[id].upBet.bets.push(bet);
            pools[id].upBet.addresses.push(msg.sender);
            pools[id].upBet.whiteLabels.push(wl);
            turnInfo.upBet.total = pools[id].upBet.total += bet;
            emit MakeBet(id, msg.sender, bet, up, turnInfo.upBet.total, token);
        }else if(up == 2){
            if( turnInfo.downBet.bets.length >= poolBetsLimit){
                revert ("no more trades accepted");
            }
            pools[id].downBet.bets.push(bet);
            pools[id].downBet.addresses.push(msg.sender);
            pools[id].downBet.whiteLabels.push(wl);
            turnInfo.downBet.total = pools[id].downBet.total += bet;
            emit MakeBet(id, msg.sender, bet, up, turnInfo.downBet.total, token);
        } else {
            revert("only up or down");
        }   
    }  

    function validateBet(uint256 bet, address token) private view {

        uint8 decimals = whiteListToken.getTokenDecimals(token);

        if(decimals == 18){
            if(bet < minBetAmount){
                revert ("below minimum");
            }
        }else if(decimals == 6){
            if(bet < minBetAmount6decimals){
                revert ("below minimum");
            }
        }else {
            revert ("invalid decimals");
        }

        if(msg.value != tax){
            revert("fee is missing");
        }
    }

    function pay(bytes32 poolId, int256 _endPrice,address[] memory referals, uint256[] memory refAmounts, 
    address[] memory investors, uint256[] memory invAmounts,uint256 prize, uint256 totalFees, 
    bytes32[] memory wLabels, uint256[] memory feePercent)public onlyGame isPaused poolExists(poolId) {

        if(pools[poolId].startPrice == _endPrice) {
            revert ("tied game");
        }

        pools[poolId].endPrice = _endPrice;
        Turn memory turnInfo = pools[poolId];

        if(turnInfo.token == address(0)){
            payNative(poolId, turnInfo, referals, refAmounts,investors, invAmounts,prize, totalFees,wLabels,feePercent);
        }else {
            payToken(poolId, turnInfo, referals, refAmounts,investors, invAmounts,prize, totalFees, turnInfo.token, wLabels,feePercent);
        }
    }

    function payNative(bytes32 poolId, Turn memory turnInfo, address[] memory referals, uint256[] memory refAmounts, 
    address[] memory investors, uint256[] memory invAmounts,uint256 prize, uint256 totalFees,bytes32[] memory wLabels, uint256[] memory feePercent) private {

        ///@dev This validation is if either of the two groups didn't place bets. 
        if(turnInfo.upBet.bets.length == 0){
            if(turnInfo.endPrice <= turnInfo.startPrice){
                returnTo(poolId,turnInfo.downBet);
            } else {
                safeTransferNative(admin,turnInfo.downBet.total);
            }
        } else if (turnInfo.downBet.bets.length == 0){            
            if(turnInfo.endPrice >= turnInfo.startPrice){
                returnTo(poolId,turnInfo.upBet);
            } else {
                safeTransferNative(admin,turnInfo.upBet.total);
            }
        }else if(turnInfo.endPrice > turnInfo.startPrice){ //upbet wining

        completeNativePaymentV2(poolId, turnInfo.upBet, turnInfo.downBet.total, referals, refAmounts, investors,  invAmounts, prize,  totalFees,wLabels,feePercent);

        }else if (turnInfo.endPrice < turnInfo.startPrice){//downbet wining 

        completeNativePaymentV2(poolId, turnInfo.downBet, turnInfo.upBet.total, referals, refAmounts, investors,  invAmounts, prize,  totalFees,wLabels,feePercent);

        }
    }

    function completeNativePaymentV2(bytes32 poolId, TradersInfo memory turnInfo,uint256 toDistribute, address[] memory referals, uint256[] memory refAmounts, 
    address[] memory investors, uint256[] memory invAmounts,uint256 prize, uint256 totalFees,bytes32[] memory wLabels, uint256[] memory feePercent) private {

            uint256 fees = winnersCalc(poolId,turnInfo, toDistribute,wLabels,feePercent);
            if(fees != totalFees){
                sendToTreasury(fees);
                emit InvalidFeeAmount(fees,totalFees, address(0));
                if(address(this).balance != 0){
                    sendToTreasury(address(this).balance);
                }
            }else {
                sendToTreasury(prize);
                DistributionFee(referals, refAmounts);
                DistributionFee(investors,invAmounts);
                if(address(this).balance != 0){
                    sendToTreasury(address(this).balance);
                }
            }
    }

    function winnersCalc(bytes32 poolId,TradersInfo memory betInfo, uint256 prizePool,bytes32[] memory wLabels, uint256[] memory feePercent) private returns(uint256 fees) {
        Profits memory profits;
        profits.prizePool = prizePool;
        uint length = betInfo.bets.length;
        uint feeDist;
        for(uint i = 0; i < length;){
            ///@dev Divide by 10000 to obtain 3 decimal places in both percentage and final values.
            profits.percentage = (betInfo.bets[i] * 10000) / betInfo.total; //The corresponding percentage is calculated on the basis of the total pool. 
            profits.reward = (profits.percentage * profits.prizePool) / 10000; //The earned reward is calculated according to the percentage
            for(uint j = 0; j < wLabels.length;){
                if(betInfo.whiteLabels[i] == wLabels[j]){
                    feeDist = feePercent[j];
                }
                unchecked {
                    ++j;
                }
            }
            if(feeDist == 0){
                feeDist = 2000; //20%
            }
            console.log("feeDist: ",feeDist);
            (uint256 toSend,uint256 feePercentage) = calcFeeV2(profits.reward,feeDist);
            safeTransferNative(betInfo.addresses[i], (toSend + betInfo.bets[i])); //Prize payment + your bet
            fees += feePercentage;
            emit PrizePaid(poolId,betInfo.addresses[i], betInfo.bets[i],toSend,profits.percentage, address(0));
            unchecked {
                ++i;
            }
        }
    }

    function calcFeeV2(uint256 _total, uint fee) private pure returns(uint256 _newtotal, uint256 percentage){
        ///@dev Divide by 10000 to obtain 3 decimal places
         percentage = (_total * fee) / 10000; 
        _newtotal = _total - percentage;

    }

    function payToken(bytes32 poolId, Turn memory turnInfo, address[] memory referals, uint256[] memory refAmounts, 
    address[] memory investors, uint256[] memory invAmounts,uint256 prize, uint256 totalFees, address token,bytes32[] memory wLabels, uint256[] memory feePercent) private {
        if(!whiteListToken.getTokenAccess(token)){
            revert ("Invalid token");
        }

        ///@dev This validation is if either of the two groups didn't place bets. 
        if(turnInfo.upBet.bets.length == 0){
            if(turnInfo.endPrice <= turnInfo.startPrice){
                returnTokenTo(poolId, turnInfo.downBet, token);
            } else {
                IERC20(token).safeTransfer(admin,turnInfo.downBet.total);
            }
        } else if (turnInfo.downBet.bets.length == 0){            
            if(turnInfo.endPrice >= turnInfo.startPrice){
                returnTokenTo(poolId, turnInfo.upBet, token);
            } else {
                IERC20(token).safeTransfer(admin,turnInfo.upBet.total);
            }
        }else if(turnInfo.endPrice > turnInfo.startPrice){ //upbet wining
            completeTokenPaymentV2(poolId, turnInfo.upBet,turnInfo.downBet.total, token, totalFees, prize, referals,  refAmounts, investors,  invAmounts,wLabels, feePercent);
        }else if (turnInfo.endPrice < turnInfo.startPrice){//downbet wining 
            completeTokenPaymentV2(poolId, turnInfo.downBet,turnInfo.upBet.total, token, totalFees, prize, referals,  refAmounts, investors,  invAmounts,wLabels, feePercent);
        }
    }

     function completeTokenPaymentV2(bytes32 poolId, TradersInfo memory turnInfo, uint256 toDistribute, address token, uint256 totalFees, 
        uint256 prize, address[] memory referals, uint256[] memory refAmounts, address[] memory investors, uint256[] memory invAmounts,
        bytes32[] memory wLabels, uint256[] memory feePercent) private {

        uint256 fees = winnersTokenCalc(poolId,turnInfo, toDistribute, token,wLabels,feePercent);
        if(fees != totalFees){
            sendTokenToTreasury(fees,token);
            emit InvalidFeeAmount(fees,totalFees, token);
            uint256 balanceAfter = IERC20(token).balanceOf(address(this));
            if(balanceAfter != 0){
                sendTokenToTreasury(balanceAfter,token);
            }
        }else {
            sendTokenToTreasury(prize,token);
            DistributionTokenFee(referals, refAmounts, token);
            DistributionTokenFee(investors,invAmounts, token);
            uint256 balanceAfter = IERC20(token).balanceOf(address(this));
            if(balanceAfter != 0){
                sendTokenToTreasury(balanceAfter,token);
            }
        }
    }

    function winnersTokenCalc(bytes32 poolId,TradersInfo memory betInfo, uint256 prizePool,address token,bytes32[] memory wLabels, uint256[] memory feePercent) private returns(uint256 fees){
        Profits memory profits;
        profits.prizePool = prizePool;
        uint length = betInfo.bets.length;
        uint feeDist;
        for(uint i = 0; i < length;){
            ///@dev Divide by 10000 to obtain 3 decimal places in both percentage and final values.
            profits.percentage = (betInfo.bets[i] * 10000) / betInfo.total; //The corresponding percentage is calculated on the basis of the total pool. 
            profits.reward = (profits.percentage * profits.prizePool) / 10000; //The earned reward is calculated according to the percentage
            for(uint j = 0; j < wLabels.length;){
                if(betInfo.whiteLabels[i] == wLabels[j]){
                    feeDist = feePercent[j];
                }
                unchecked {
                    ++j;
                }
            }
            if(feeDist == 0){
                feeDist = 2000; //20%
            }
            (uint256 toSend,uint256 feePercentage) = calcFeeV2(profits.reward,feeDist);
            IERC20(token).safeTransfer(betInfo.addresses[i],(toSend + betInfo.bets[i]));//Prize payment + your bet
            fees += feePercentage;
            emit PrizePaid(poolId,betInfo.addresses[i], betInfo.bets[i], toSend,profits.percentage, token);
            unchecked {
                ++i;
            }
        }
    } 

     function tiedGame(bytes32 poolId, int256 _endPrice, bytes32 _newPoolId) public onlyGame isPaused poolExists(poolId) {
        int256 _start = pools[poolId].startPrice;
        if(_endPrice != _start){
            revert ("no tie");
        }
        pools[poolId].endPrice = _endPrice;

        TradersInfo memory upInfo = pools[poolId].upBet;
        TradersInfo memory downInfo = pools[poolId].downBet;
        pools[_newPoolId].upBet = upInfo;
        pools[_newPoolId].downBet = downInfo;

       address token = pools[poolId].token;
        if(token != address(0)){
            pools[_newPoolId].token = token;
        }
         emit tiedRound(poolId,_start,_endPrice,_newPoolId, token);
    }

    function DistributionFee(address[] memory users, uint256[] memory amounts) private {
        uint length = users.length;
        for (uint i = 0; i < length;) {
            safeTransferNative(users[i], amounts[i]);
            emit FeePaid(users[i], amounts[i], address(0));
            unchecked{
                ++i;
            }
        }
    }

    function DistributionTokenFee(address[] memory users, uint256[] memory amounts, address token) private {
        uint length = users.length;
        for (uint i = 0; i < length;) {
            IERC20(token).safeTransfer(users[i], amounts[i]);
            emit FeePaid(users[i], amounts[i], token);
            unchecked{
                ++i;
            }
        }
    }

    function sendTax() private {
        safeTransferNative(taxWallet, tax); 
    }


    function returnTo(bytes32 poolId, TradersInfo memory bettors) private {
         uint256 bettorsLength = bettors.bets.length;

        for (uint i = 0; i < bettorsLength;) {
            safeTransferNative(bettors.addresses[i], bettors.bets[i]);
            emit ReturnBet(poolId, bettors.addresses[i], bettors.bets[i], address(0));
            unchecked{
                ++i;
            }
        }
    }

     function returnTokenTo(bytes32 poolId, TradersInfo memory bettors, address token) private {
         uint256 bettorsLength = bettors.bets.length;

        for (uint i = 0; i < bettorsLength;) {
            IERC20(token).safeTransfer(bettors.addresses[i], bettors.bets[i]);
            emit ReturnBet(poolId, bettors.addresses[i], bettors.bets[i], token);
            unchecked{
                ++i;
            }
        }
    }

    function jackpot(address[] memory recipient, uint256[] memory prize, uint256 totalPrize, address token) public onlyGame isPaused {
        if(token == address(0)){
            jackpotNative(recipient, prize, totalPrize);
        }else {
            jackpotToken(recipient, prize, totalPrize, token);
        }
    }

    function jackpotNative(address[] memory recipient, uint256[] memory prize, uint256 totalPrize) private {
        uint256 length = recipient.length; 
        awardVault.withdraw(totalPrize);
        for(uint i = 0; i < length;){
            safeTransferNative(recipient[i], prize[i]);
            emit Jackpot(recipient[i],prize[i], address(0));
            unchecked{
                ++i;
            }
        }
    }

    function jackpotToken(address[] memory recipient, uint256[] memory prize, uint256 totalPrize, address token) private {
        if(!whiteListToken.getTokenAccess(token)){
            revert ("Invalid token");
        }
        uint256 length = recipient.length; 
        awardVault.withdrawToken(totalPrize,token);
        for(uint i = 0; i < length;){
            IERC20(token).safeTransfer(recipient[i], prize[i]);
            emit Jackpot(recipient[i],prize[i],token);
            unchecked{
                ++i;
            }
        }
    }

    function getPoolInfo(bytes32 idPool) public view returns(Turn memory info){
        return pools[idPool];
    }

    function sendToTreasury(uint256 amount) private {
        awardVault.deposit{value: amount}();
    }

    function sendTokenToTreasury(uint256 amount, address token) private {
        awardVault.depositToken(amount,token);
    }

    function safeTransferNative(address to, uint256 value) private {
        (bool success, ) = to.call{value: value}(new bytes(0));
        require(success, 'Native transfer failed');
    }

    function approval(address token) public onlyAdministrator {
        IERC20(token).forceApprove(address(awardVault), 2**255);
    }
    function pause(bool _status) public onlyAdministrator {
        paused = _status;
    }

    function updateVault(address _newVault) public onlyAdministrator {
        awardVault = IAwardVault(_newVault);
    }

    function updateWhitelist(address _newWhitelist) public onlyAdministrator {
        whiteListToken = IWhiteListToken(_newWhitelist);
    }

    function updateLimiteBet(uint64 _poolBetsLimit) public onlyAdministrator {
        poolBetsLimit = _poolBetsLimit;
    }

    function updateMinBet(uint256 _newMinBet) public onlyAdministrator {
        minBetAmount = _newMinBet;
    }

    function updateMinBet6Decimals(uint256 _newMinBet) public onlyAdministrator {
        minBetAmount6decimals = _newMinBet;
    }

    function updateTax(uint64 _newTax) public onlyAdministrator {
        if(_newTax > 0.1 ether) {
            revert ("les than 0.1");
        }
        tax = _newTax;
    }

    function getTax() public view returns(uint _tax){
        return tax;
    }

    function updateTaxWallet(address _newTaxWallet) public onlyAdministrator {
        taxWallet = _newTaxWallet;
    }

    function setInvestor(address user, uint256 percentage) public onlyAdministrator {
        investor[user] = percentage;
    }

    receive() payable external {}
}"
    },
